import React from 'react';
import './Navbar.css';
import logo from '..Assets/Home_icon.png'
const Navbar = () => {
    return (
       <div className="navbar">
           <div className="navbar-logo">
               <img src={logo} alt="logo"/>
               <p>Home</p>
           </div>
       </div>
    );
    }

export default Navbar;
